  return (
    <>
      <Routes>
      <Route path="/" element={<Layout />}>
      <Route path="home" element={<Home />} />
          <Route path="about" element={<About />} />
          <Route path="Ww1AndRusRev" element={<Ww1AndRusRev />} />
          </Route>
      </Routes>
    </>
  )
}

export default App;
